import React, { useState } from 'react';
import './index.css';

let count = 0;

const App = () => {
    const s = useState();
    const [count, Inc] = useState(0);
    
    const click = () => {
        Inc(count + 1);
    };

    return (
        <>
            <div className='ab'>
                <h1>{count}</h1>
                <button type="button" onClick={click}>Click Me</button>
            </div>
        </>
    );
}

export default App;
